import React from "react";
import styled from "styled-components";
import { FaTrash, FaEdit } from "react-icons/fa";
const Table = styled.table`
    width: 100%;
    background-color: #fff;
    padding: 20px;
    box-shadow: 0px 0px 5px #ccc;
    box-radius: 5px;
    margin: 20px auto;
    word-brak: break-all;
`;

const Grid = () => {
    return (
        <Table>

        </Table>
    );
};

export default Grid;
